import React, { useEffect, useRef } from "react";
import "../../css/HomePage.css";
import apple from "../../Images/apple.png";
import banana from "../../Images/banana.png";
import orange from "../../Images/orange.png";
import strawberry from "../../Images/strawberry.png";
// Import your icons or images for the circles here
import icon1 from "../../Images/success.png";
import icon2 from "../../Images/insights.png";
import icon3 from "../../Images/clock.png";

const Home = () => {
  const circleRef = useRef(null);
  const lowerSectionRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          entry.target.classList.add("animate");
          observer.unobserve(entry.target);
        }
      },
      { threshold: 0.1 }
    );

    const checkInitialVisibility = (ref) => {
      if (ref.current) {
        const rect = ref.current.getBoundingClientRect();
        if (rect.top < window.innerHeight && rect.bottom >= 0) {
          ref.current.classList.add("animate");
        } else {
          observer.observe(ref.current);
        }
      }
    };

    checkInitialVisibility(circleRef);
    checkInitialVisibility(lowerSectionRef);

    return () => {
      if (circleRef.current) {
        observer.unobserve(circleRef.current);
      }
      if (lowerSectionRef.current) {
        observer.unobserve(lowerSectionRef.current);
      }
    };
  }, []);

  return (
    <div className="home-container">
      <div className="upper-section">
        <div className="content-wrapper">
          <div className="left-content">
            <h1 className="welcome-text">
              <span className="welcome-to">Welcome to</span>
              <br />
              <span className="fitness-tracker">Fitness-Tracker</span>
            </h1>
            <button className="get-started-button">Get Started</button>
          </div>
        </div>
        <div className="green-circle" ref={greenCircleRef}></div>
        <img
          src={apple}
          alt="Apple"
          className="fruit fruit-1"
          ref={fruit1Ref}
        />
        <img
          src={banana}
          alt="Banana"
          className="fruit fruit-2"
          ref={fruit2Ref}
        />
        <img
          src={orange}
          alt="Orange"
          className="fruit fruit-3"
          ref={fruit3Ref}
        />
        <img
          src={strawberry}
          alt="Strawberry"
          className="fruit fruit-4"
          ref={fruit4Ref}
        />
      </div>

      <div className="lower-section" ref={lowerSectionRef}>
        <h2 className="why-fitness">Why Fitness Tracker?</h2>
        <div className="circle-container">
          <div className="circle">
            <img src={icon1} alt="Feature 1" className="circle-icon" />
            <p>Feature 1</p>
            <img
              src={apple}
              alt="Apple"
              className="circle-fruit circle-fruit-left"
            />
          </div>
          <div className="circle middle-circle">
            <img src={icon2} alt="Feature 2" className="circle-icon" />
            <p>Feature 2</p>
          </div>
          <div className="circle">
            <img src={icon3} alt="Feature 3" className="circle-icon" />
            <p>Feature 3</p>
            <img
              src={banana}
              alt="Banana"
              className="circle-fruit circle-fruit-right"
            />
          </div>
        </div>
      </div>

      <div className="small-green-circle-container" ref={circleRef}>
        <div className="small-green-circle"></div>
        <img src={orange} alt="Orange" className="small-fruit small-fruit-1" />
        <img
          src={strawberry}
          alt="Strawberry"
          className="small-fruit small-fruit-2"
        />
      </div>
      <div className="quote-section">
        <h3 className="quote-name">John Doe</h3>
        <p className="quote-text">
          "This is a placeholder for an inspiring quote about fitness and
          health."
        </p>
      </div>
    </div>
  );
};

export default Home;
